import{_ as e,o as a,c as n,Q as t}from"./chunks/framework.6e0d310a.js";const g=JSON.parse('{"title":"TeamOne","titleTemplate":"FAQ","description":"","frontmatter":{"title":"TeamOne","titleTemplate":"FAQ"},"headers":[],"relativePath":"faq.md","filePath":"faq.md"}'),o={name:"faq.md"},i=t('<h1 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h1><h2 id="what-access-does-teamone-require" tabindex="-1">What access does TeamOne require? <a class="header-anchor" href="#what-access-does-teamone-require" aria-label="Permalink to &quot;What access does TeamOne require?&quot;">​</a></h2><p>When you install TeamOne add-on it will ask you for the next permissions:</p><table><thead><tr><th style="text-align:left;">Permission</th><th>Description</th></tr></thead><tbody><tr><td style="text-align:left;">See your primary Google Account email address</td><td>TeamOne needs your email address to verify the license status. This is the only personal information TeamOne has access to.</td></tr><tr><td style="text-align:left;">Display and run third-party web content in prompts and sidebars inside Google applications</td><td>TeamOne requires permission to display a sidebar and additional screens (within Google Sheets application) to enable its functionality.</td></tr><tr><td style="text-align:left;">Connect to an external service</td><td>TeamOne needs permission to connect to IBM Planning Analytics REST API in order to integrate IBM Planning Analytics data into Google Sheets.</td></tr><tr><td style="text-align:left;">View and manage spreadsheets that this application has been installed in</td><td>TeamOne needs permission to modify the current Google Sheets document, such as adding new tabs and loading data from IBM Planning Analytics. TeamOne cannot access your other documents.</td></tr></tbody></table><p>TeamOne’s use and transfer of information received from Google APIs to any other app will adhere to <a href="https://developers.google.com/terms/api-services-user-data-policy" target="_blank" rel="noreferrer">Google API Services User Data Policy</a>, including the Limited Use requirements.</p><h2 id="do-i-need-to-buy-any-google-subscription-for-teamone" tabindex="-1">Do I need to buy any Google subscription for TeamOne? <a class="header-anchor" href="#do-i-need-to-buy-any-google-subscription-for-teamone" aria-label="Permalink to &quot;Do I need to buy any Google subscription for TeamOne?&quot;">​</a></h2><p>No. Even a free gmail account would work for individual licenses. Though if you purchase a Google Workspace plan, you will be able to install and configure TeamOne for all your users.</p><h2 id="does-any-server-side-software-need-to-be-installed" tabindex="-1">Does any server side software need to be installed? <a class="header-anchor" href="#does-any-server-side-software-need-to-be-installed" aria-label="Permalink to &quot;Does any server side software need to be installed?&quot;">​</a></h2><p>No. TeamOne lives in Google Cloud and does not require anything to be installed on IBM PA (TM1) server or you computer.</p><h2 id="will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" tabindex="-1">Will any of my data be sent or stored on any 3rd party servers? <a class="header-anchor" href="#will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" aria-label="Permalink to &quot;Will any of my data be sent or stored on any 3rd party servers?&quot;">​</a></h2><p>TeamOne connects directly from your browser to IBM Planning Analytics / TM1 server. No data is being sent or stored on any other servers.</p><h2 id="can-teamone-connect-to-ibm-planning-analytics-cloud" tabindex="-1">Can TeamOne connect to IBM Planning Analytics Cloud <a class="header-anchor" href="#can-teamone-connect-to-ibm-planning-analytics-cloud" aria-label="Permalink to &quot;Can TeamOne connect to IBM Planning Analytics Cloud&quot;">​</a></h2><p>Yes, TeamOne can connect to IBM PA cloud. You can configure a Single-Sign-On or use a non-interactive user account.</p><h2 id="what-ibm-planning-analytics-version-is-supported" tabindex="-1">What IBM Planning Analytics version is supported <a class="header-anchor" href="#what-ibm-planning-analytics-version-is-supported" aria-label="Permalink to &quot;What IBM Planning Analytics version is supported&quot;">​</a></h2><p>Even though some functionality may work in the older versions, TeamOne add-on officially supports IBM Planning Analytics version 2.0.9 or newer.</p><h2 id="which-tm1-integratedsecuritymode-does-teamone-support" tabindex="-1">Which TM1 IntegratedSecurityMode does TeamOne support? <a class="header-anchor" href="#which-tm1-integratedsecuritymode-does-teamone-support" aria-label="Permalink to &quot;Which TM1 IntegratedSecurityMode does TeamOne support?&quot;">​</a></h2><p>TeamOne supports the next TM1 integrated security modes: 1 (native TM1 security), 4 and 5 (Cognos security)</p><h2 id="is-security-tied-to-ibm-planning-analytics" tabindex="-1">Is security tied to IBM Planning Analytics? <a class="header-anchor" href="#is-security-tied-to-ibm-planning-analytics" aria-label="Permalink to &quot;Is security tied to IBM Planning Analytics?&quot;">​</a></h2><p>Yes, when connecting from Google Sheets, users can only access data and perform actions based on their roles and permissions configured in IBM Planning Analytics.</p><h2 id="do-users-need-technical-skills-to-query-ibm-planning-analytics-data" tabindex="-1">Do users need technical skills to query IBM Planning Analytics data? <a class="header-anchor" href="#do-users-need-technical-skills-to-query-ibm-planning-analytics-data" aria-label="Permalink to &quot;Do users need technical skills to query IBM Planning Analytics data?&quot;">​</a></h2><p>No, TeamOne allows users to focus on business insights without requiring technical skills.</p><ul><li><strong>TEAMONE() Function</strong>: Fetches data without needing dimension names, element orders, or hierarchy details. TeamOne automatically identifies relevant dimensions, applies default hierarchy members, and alerts users to errors like invalid element names or mismatched dimensions.</li><li><strong>MDX() Function &amp; Explorations</strong>: Enable users to build dynamic queries using simplified MDX expressions (TeamOne MDX Mods) without technical expertise.</li></ul><p>With TeamOne, users can analyze data and make informed decisions without worrying about complex query structures.</p><p>Learn more: <a href="https://succeedium.com/teamone/doc/functions.html#mdx-mods" target="_blank" rel="noreferrer">MDX Mods</a></p><h2 id="does-teamone-provide-a-formula-builder" tabindex="-1">Does TeamOne provide a formula builder? <a class="header-anchor" href="#does-teamone-provide-a-formula-builder" aria-label="Permalink to &quot;Does TeamOne provide a formula builder?&quot;">​</a></h2><p>Yes, TeamOne simplifies formula creation and exploration setup with intuitive tools.</p><ul><li><strong>Formula &amp; Exploration Generation</strong>: Automatically generates formulas and explorations based on existing cube views. Users can also use an interactive interface to select dimension elements, design query layouts, and build reports effortlessly—no technical expertise required.</li><li><strong>Automated Dimension Detection</strong>: The <strong>TEAMONE()</strong> function intelligently identifies relevant dimensions, eliminating manual input and streamlining data retrieval and analysis.</li></ul><h2 id="is-training-available-for-teamone-users" tabindex="-1">Is training available for TeamOne users? <a class="header-anchor" href="#is-training-available-for-teamone-users" aria-label="Permalink to &quot;Is training available for TeamOne users?&quot;">​</a></h2><p>Yes, we offer training to help users effectively navigate and utilize TeamOne.</p><h2 id="where-is-teamone-hosted-what-about-data-residency-compliance-and-latency" tabindex="-1">Where is TeamOne hosted? What about data residency, compliance, and latency? <a class="header-anchor" href="#where-is-teamone-hosted-what-about-data-residency-compliance-and-latency" aria-label="Permalink to &quot;Where is TeamOne hosted? What about data residency, compliance, and latency?&quot;">​</a></h2><p>TeamOne runs on Google Cloud Platform (GCP) like all Google Workspace add-ons. However, data in Google Sheets follows your Google Workspace settings, ensuring compliance with your organization&#39;s data residency requirements.</p><h2 id="how-does-teamone-protect-data-does-it-use-encryption-and-meet-security-standards" tabindex="-1">How does TeamOne protect data? Does it use encryption and meet security standards? <a class="header-anchor" href="#how-does-teamone-protect-data-does-it-use-encryption-and-meet-security-standards" aria-label="Permalink to &quot;How does TeamOne protect data? Does it use encryption and meet security standards?&quot;">​</a></h2><p>TeamOne secures data in transit with TLS 1.2+ and encrypts data at rest using AES-256. It adheres to SOC 2 standards and is undergoing a continuous 12-month SOC 2 Type 2 audit.</p><h2 id="does-teamone-integrate-with-other-google-workspace-applications" tabindex="-1">Does TeamOne integrate with other Google Workspace applications? <a class="header-anchor" href="#does-teamone-integrate-with-other-google-workspace-applications" aria-label="Permalink to &quot;Does TeamOne integrate with other Google Workspace applications?&quot;">​</a></h2><p>TeamOne doesn’t directly integrate with other Google Workspace apps but leverages Google Sheets&#39; native connections to Docs, Slides, and Forms. Linked data updates automatically, allowing seamless synchronization across applications.</p><h2 id="how-is-teamone-deployed-and-configured" tabindex="-1">How is TeamOne deployed and configured? <a class="header-anchor" href="#how-is-teamone-deployed-and-configured" aria-label="Permalink to &quot;How is TeamOne deployed and configured?&quot;">​</a></h2><p>TeamOne is a Google Workspace add-on that can be installed from the Google Workspace Marketplace with no technical expertise required. Administrators can pre-install it for users via the Google Admin console and configure IBM Planning Analytics connections in advance, enabling immediate access.</p><h2 id="what-are-the-ongoing-maintenance-and-upgrade-requirements-for-teamone" tabindex="-1">What are the ongoing maintenance and upgrade requirements for TeamOne? <a class="header-anchor" href="#what-are-the-ongoing-maintenance-and-upgrade-requirements-for-teamone" aria-label="Permalink to &quot;What are the ongoing maintenance and upgrade requirements for TeamOne?&quot;">​</a></h2><p>TeamOne receives automatic updates via the Google Workspace Marketplace, ensuring access to the latest features, security patches, and performance improvements. Updates are applied seamlessly in the background, requiring no downtime or manual intervention.</p><h2 id="does-teamone-affect-google-sheets-performance-with-large-datasets-or-complex-formulas" tabindex="-1">Does TeamOne affect Google Sheets&#39; performance with large datasets or complex formulas? <a class="header-anchor" href="#does-teamone-affect-google-sheets-performance-with-large-datasets-or-complex-formulas" aria-label="Permalink to &quot;Does TeamOne affect Google Sheets&#39; performance with large datasets or complex formulas?&quot;">​</a></h2><p>No, TeamOne is designed for efficiency. It recalculates only when inputs change and uses data chunking to handle large datasets smoothly without slowing down Google Sheets.</p><h2 id="does-teamone-require-a-constant-internet-connection" tabindex="-1">Does TeamOne require a constant internet connection? <a class="header-anchor" href="#does-teamone-require-a-constant-internet-connection" aria-label="Permalink to &quot;Does TeamOne require a constant internet connection?&quot;">​</a></h2><p>Yes, TeamOne needs an active internet connection to function, as it communicates with the Google Sheets API.</p><h2 id="what-are-the-top-benefits-of-teamone" tabindex="-1">What are the top benefits of TeamOne? <a class="header-anchor" href="#what-are-the-top-benefits-of-teamone" aria-label="Permalink to &quot;What are the top benefits of TeamOne?&quot;">​</a></h2><ul><li><strong>User-Friendly Formulas</strong>: Intuitive formulas eliminate the need for technical knowledge, automatically handling dimension selection and cube structures.</li><li><strong>Self-Service Reporting</strong>: Users can access IBM Planning Analytics (IPA) data and create reports in Google Sheets without relying on IT, enabling agility and faster decision-making.</li><li><strong>Seamless Collaboration</strong>: Works within Google Sheets, allowing easy sharing and collaboration without additional software installation—accessible on any device.</li></ul>',45),s=[i];function r(l,d,c,h,u,m){return a(),n("div",null,s)}const y=e(o,[["render",r]]);export{g as __pageData,y as default};
